  "text" : "\uADF8\uB7F0 \uC5EC\uC131\uB4E4\uC740 \uACBD\uC81C\uB825\uC774 \uC5C6\uB294 \uACBD\uC6B0\uAC00 \uB9CE\uAE30\uC5D0 \uB3C4\uB9DD\uC744 \uCCE4\uB2E4\uAC00\uB3C4 \uACE7\uBC14\uB85C \uC7A1\uD600\uC624\uB294 \uACBD\uC6B0\uB3C4 \uB9CE\uACE0, \uADF8\uB7F0 \uC0C1\uD669\uC5D0 \uC644\uC804\uD788 \uC801\uC751\uC744 \uD574\uBC84\uB824\uC11C, \uB0A8\uD3B8\uC758 \uD559\uB300\uB97C \uB108\uBB34\uB098 \uB2F9\uC5F0\uD788 \uC5EC\uAE30\uAC8C \uB418\uC5B4 \uADF8\uC870\uCC28\uB3C4 \uC560\uC815\uC73C\uB85C \uBC1B\uC544\uB4E4\uC5EC \uB5A0\uB098\uC9C0 \uBABB\uD558\uB294 \uACBD\uC6B0\uAE4C\uC9C0\uB3C4 \uC788\uACE0.. \uADF8\uAC8C \uC26C\uC6B4 \uBB38\uC81C\uAC00 \uC544\uB2D8",
