  "text" : "\uC218\uB2E8\uC774 \uB418\uB294 \uAC83\uB3C4 \uC544\uB2C8\uB2E4. \uB530\uB77C\uC11C \uC6B0\uB9AC\uD615\uBC95\uC740 \uAC00\uC911\uC8FC\uC758\uB97C \uC911\uC2EC\uC5D0, \uD761\uC218\uC8FC\uC758\uC640 \uBCD1\uACFC\uC8FC\uC758\uB294 \uC8FC\uBCC0\uC5D0 \uAC01\uAC01 \uB450\uACE0, \uC218\uC8C4\uC758 \uC120\uD0DD\uD615 \uB610\uB294 \uCC98\uB2E8\uD615\uC774 \uBB34\uC5C7\uC778\uAC00\uB97C \uB530\uB77C \uC774 \uC911 \uD558\uB098\uB97C \uC120\uD0DD\uD558\uB3C4\uB85D \uD55C \uAC83\uC774\uB2E4.\"\n\n\u300C\uD615\uBC8C\uAC00\uC911\uCCB4\uACC4\uC758 \uAC1C\uC120\uBC29\uC548\u300D \uC724\uB3D9\uD638, \uD558\uD0DC\uC601 (\uD615\uC0AC\uC815\uCC45\uC5F0\uAD6C\uC6D0)",
