  "text" : "\uC720\uAE30\uC758 \uAD6C\uBCC4\uC744 \uC758\uBBF8\uC5C6\uAC8C \uD55C\uB2E4. \uB610 \uD615\uBC8C\uC758 \uD6A8\uACFC\uB294 \uADF8 \uAE30\uAC04\uC5D0 \uBE44\uB840\uD558\uB294 \uAC83\uC774 \uC544\uB2C8\uB77C \uC624\uD788\uB824 \uB204\uC9C4\uC801\uC774\uB2E4. \uB2EC\uB9AC \uB9D0\uD574 \uC218\uC8C4\uC5D0 \uB300\uD55C \uB2E4\uC218\uC758 \uD615\uC758 \uC5F0\uC18D\uC801 \uC9D1\uD589\uC740 \uAC1C\uBCC4\uC801 \uC9D1\uD589\uBCF4\uB2E4 \uB354 \uD070 \uACE0\uD1B5\uC77C\uC218 \uC788\uB2E4. \uBCD1\uACFC\uC8FC\uC758\uAC00 \uBC18\uB4DC\uC2DC \uD589\uC704\uC790\uC5D0\uAC8C \uD615\uBC8C\uC758 \uBAA9\uC801\uC744 \uB2EC\uC131\uD558\uB294 \uD6A8\uACFC\uC801\uC778",
