  "text" : "\uADFC\uB370 \uC774\uCC98\uB7FC \uB113\uAC8C \uC720\uAE30\uC801\uC73C\uB85C \uBCF4\uAE30\uC758 \uB2E8\uC810\uC740 '\uB2E8\uC5B4 \uC0B4\uC9DD \uBC14\uAFB8\uAE30' \uB4F1\uC758 \uD568\uC815\uC5D0 \uB9E4\uC6B0 \uCDE8\uC57D\uD558\uB2E4\uB294 \uAC83\uC774\uC5C8\uB294\uB370, \uADF8\uAC74 \uD574\uB2F9 \uACFC\uBAA9\uC758 \uACFC\uAC70 \uAE30\uCD9C\uBB38\uC81C\uB97C \uD480\uC5B4\uBCF4\uB294 \uAC83\uC73C\uB85C \uAC15\uC57D\uC744 \uC870\uC808\uD558\uBA70 \uB300\uBE44\uD588\uC74C.. \uAC1C\uC778\uC801\uC73C\uB85C\uB294 \uBAA8\uC758\uACE0\uC0AC \uBCF4\uB2E4\uB294 \uAE30\uCD9C\uBB38\uC81C\uB97C \uD478\uB294 \uAC83\uC744 \uC911\uC694\uC2DC\uD558\uB294 \uC2A4\uD0C0\uC77C",
