  "text" : "\uADF8\uB807\uAE30\uC5D0 \uC720\uC608\uAE30\uAC04 \uC911\uC5D0 \uBED8\uC9D3\uD558\uB2E4 \uAC78\uB9AC\uBA74 \uC774\uB294 \uBC95\uC6D0\uACFC \uC0AC\uD68C\uC758 \uC2E0\uB8B0\uB97C \uBC30\uBC18\uD55C \uAC83\uC774\uBBC0\uB85C \uC9D1\uD589\uC720\uC608\uAC00 \uC2E4\uD6A8\uB418\uAC70\uB098 \uCDE8\uC18C\uB418\uC5B4 \uD615 \uC9D1\uD589\uC5D0 \uB4E4\uC5B4\uAC00\uAC8C \uB418\uBA70, \uC720\uC608\uAE30\uAC04 \uC911 \uBED8\uC9D3\uC758 \uACBD\uC6B0\uC5D0\uB294 \uC2EC\uC9C0\uC5B4 \uAC00\uC911\uCC98\uBC8C\uC744 \uBC1B\uAC8C \uB429\uB2C8\uB2E4. \uADF8\uB798\uC11C \uC9D1\uD589\uC720\uC608\uAE30\uAC04 \uB3D9\uC548\uC5D0\uB294 \uBB34\uCC99 \uBAB8\uC744 \uC0AC\uB9AC\uAC8C \uB418\uC8E0",
