  "text" : "\uC5EC\uD2BC, \uB2E4\uC2DC \uB9D0\uD558\uC9C0\uB9CC \uC9D1\uD589\uC720\uC608\uB294 \uBB34\uC8C4\uAC00 \uC544\uB2D9\uB2C8\uB2E4. '\uC720\uC8C4'\uC774\uACE0 \uD615\uAE4C\uC9C0 \uD655\uC815\uB418\uC9C0\uB9CC, \uCC38\uC791\uD560\uB9CC\uD55C \uC0AC\uC720\uAC00 \uC788\uC5B4 \uADF8 \uD615\uC758 \uC9D1\uD589\uB9CC \uC77C\uC815\uAE30\uAC04 \uBBF8\uB904\uC8FC\uBA70, \uADF8 \uAE30\uAC04\uB3D9\uC548 \uBC18\uC131\uD558\uBA70 \uCC29\uD558\uACE0 \uBC14\uB974\uAC8C \uC0B0\uB2E4\uBA74 \uC774\uB97C \uAE30\uD2B9\uD788 \uC5EC\uACA8\uC11C \uAE30\uC874\uC758 \uD615 \uC120\uACE0\uC870\uCC28 \uBB34\uD6A8\uB85C \uD574\uC8FC\uACA0\uB2E4\uB294 \uB73B\uC785\uB2C8\uB2E4.",
