  "text" : "\uC774 \uC0C1\uD669\uC774 \uADF8\uC800 \uC544\uB7AB\uC0AC\uB78C\uB4E4\uC744 \uC870\uC9C4\uB2E4\uACE0 \uB098\uC544\uC9C8 \uAC83\uC774\uB77C \uC0DD\uAC01\uD558\uC2ED\uB2C8\uAE4C. \uC870\uC9C0\uB824\uBA74 \uC717\uC0AC\uB78C\uBD80\uD130 \uC870\uC838\uC57C \uD6A8\uACFC\uAC00 \uC788\uC8E0.\n\n\uC6B0\uB9AC\uB294 '\uC77C\uB2E8 \uC544\uB798\uBD80\uD130 \uC870\uC9C0\uACE0 \uBCF4\uC790'\uB294 \uB9C8\uC778\uB4DC\uC5D0\uC11C \uC808\uB300 \uBC97\uC5B4\uB0A0 \uC218 \uC5C6\uC744 \uAC83 \uAC19\uB2E4. \uD68C\uC0AC \uB4F1\uC758 \uC870\uC9C1\uC0AC\uD68C\uB294 \uBB3C\uB860\uC774\uAC70\uB2C8\uC640, \uC8C4\uC640 \uD615\uBC8C\uC758 \uC601\uC5ED\uAE4C\uC9C0\uB3C4.",
