  "text" : "\uACE0\uB824\uD558\uC5EC \uACB0\uC815\uD558\uC5EC\uC57C \uD560 \uAD6D\uAC00\uC758 \uC785\uBC95\uC815\uCC45\uC5D0 \uAD00\uD55C \uC0AC\uD56D\uC73C\uB85C\uC11C \uAD11\uBC94\uC704\uD55C \uC785\uBC95\uC7AC\uB7C9 \uB0B4\uC9C0 \uD615\uC131\uC758 \uC790\uC720\uAC00 \uC778\uC815\uB418\uC5B4\uC57C \uD560 \uBD84\uC57C\uC774\uB2E4. \uB530\uB77C\uC11C \uC5B4\uB290 \uBC94\uC8C4\uC5D0 \uB300\uD55C \uBC95\uC815\uD615\uC774 \uADF8 \uC8C4\uC9C8\uACFC \uC774\uC5D0 \uB300\uD55C \uD589\uC704\uC790\uC758 \uCC45\uC784\uC5D0 \uBE44\uD558\uC5EC \uC9C0\uB098\uCE58\uAC8C \uAC00\uD639\uD55C \uAC83\uC774\uC5B4\uC11C \uC804\uCCB4 \uD615\uBC8C\uCCB4\uACC4\uC0C1 \uD604\uC800\uD788",
