  "text" : "\uC870\uB450\uC21C\uC758 '\uC5C4\uBC8C'\uC5D0 \uB300\uD574 \uAC15\uD55C \uC758\uC9C0\uB97C \uAC00\uC9C0\uACE0 \uC788\uC5C8\uB2E4\uB294 \uAC83\uC744 \uC54C \uC218 \uC788\uC73C\uBA70, \uC5EC\uB860\uC744 \uBC18\uC601\uD558\uC5EC \uC131\uBC94\uC8C4\uC5D0 \uB300\uD55C \uC591\uD615\uAE30\uC900\uAE4C\uC9C0 \uC0C1\uD5A5 \uC870\uC815\uC2DC\uCF1C \uBC84\uB9BD\uB2C8\uB2E4.\n\n\uADF8\uB7F0\uB370 \uBC95\uC6D0\uC73C\uB85C\uC11C\uB294 \uBC95\uC5D0 \uC758\uD574- \uADF8\uB9AC\uACE0 \uBC95\uC5D0 \uB530\uB77C \uC7AC\uD310\uC744 \uD588\uC74C\uC5D0\uB3C4 \uBD88\uAD6C\uD558\uACE0 \uD310\uC0AC\uC0C8\uB07C\uB77C\uBA70 \uC695\uC744 \uBA39\uACE0 \uC788\uC73C\uB2C8",
