  "text" : "\uC18D\uC0AC\uC815\uC744 \uC81C\uB300\uB85C \uC54C\uC9C0\uB3C4 \uBABB\uD558\uBA74\uC11C, \uD0C0\uC784\uB77C\uC778\uC5D0\uC11C \uBCF4\uC774\uB294 (\uAC1C\uC778\uC801 \uC0AC\uC815\uC5D0 \uAD00\uD55C)\uD0C0\uC778\uC758 \uBD84\uB178\uC5D0 \uB300\uD574 \uC774\uB7EC\uCFF5 \uC800\uB7EC\uCFF5 \uD558\uB294 \uC0AC\uB78C\uB4E4\uC744 \uBCF4\uBA74 \uC194\uC9C1\uD788 \uC880 \uC774\uD574\uAC00 \uAC00\uC9C0 \uC54A\uB294 \uAC83\uC774 \uC0AC\uC2E4\uC774\uB2E4. \uD639\uC2DC \uB2C8\uB4E4\uC774 \uB0B4\uB358 \uD654\uC640, \uC800\uB4E4\uC774 \uB0B4\uACE0 \uC788\uB294 \uD654\uB294 \uADFC\uBCF8\uC801\uC73C\uB85C \uB2E4\uB974\uB2E4\uACE0 \uC0DD\uAC01\uD558\uB0D0?",
