  "text" : "\uC5EC\uC131\uC778 \uADFC\uB85C\uC790\uAC00 \uC0DD\uB9AC\uD734\uAC00\uAE30\uC77C\uC5D0 \uD734\uAC00\uB97C \uC0AC\uC6A9\uD558\uC9C0 \uC544\uB2C8\uD558\uACE0 \uADFC\uB85C\uD55C \uACBD\uC6B0\uC5D0\uB294 \uADFC\uB85C\uC758\uBB34\uAC00 \uBA74\uC81C\uB41C \uD2B9\uC815\uC77C\uC5D0 \uCD94\uAC00\uB85C \uADFC\uB85C\uB97C \uC81C\uACF5\uD55C \uAC83\uC774\uBBC0\uB85C \uC0AC\uC6A9\uC790\uB294 \uB2F9\uC5F0\uD788 \uADF8 \uADFC\uB85C\uC758 \uB300\uAC00\uB85C\uC11C \uC774\uC5D0 \uC0C1\uC751\uD558\uB294 \uC0DD\uB9AC\uD734\uAC00\uADFC\uB85C\uC218\uB2F9\uB3C4 \uC9C0\uAE09\uD558\uC5EC\uC57C \uD55C\uB2E4. \uC5F0\u00B7\uC6D4\uCC28\uD734\uAC00\uC758 \uACBD\uC6B0\uC5D0\uB3C4 \uC9C0\uAE09\uD558\uB294",
